import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.css';
import Background from './background.jpg';
import NavBar from './navbar';
import Home from './home'
import Overview from "./overview";
import Register from './register';

const current = <Home />;

class NewSX extends React.Component {


    state = {page: <Home setActivePage={this.activePage}/>};

    activePage = (page) => {
        switch(page) {
            case "home":
                this.setState({page: <Home setActivePage={this.activePage}/>});
                break;
            case "register":
                this.setState({page: <Register setActivePage={this.activePage}/>});
                break;
            case "overview":
                this.setState({page: <Overview setActivePage={this.activePage}/>});
                break;
        }
    };

    render() {
        return (
            <div className="new_sx">
                <img id="background" src={ Background } alt="" />
                <div className="navBar">
                    <NavBar />
                </div>
                <div className="register_box" >
                    <Route path="/" component={Home} />
                    <Route path="/users" component={Users} />
                    <Route path="/contact" component={Contact} />
                </div>
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <NewSX />,
    document.getElementById('root')
);
